The provided function extracts all the brackets in the given formula and creates a variable `brackets` to store the brackets. It iterates over the expression and the function uses the `<+>` and `-<+-` brackets notation to define the opening and closing brackets. The function then returns the modified input to the function.

```python
def create_brackets_output(expression):
    brackets = {
        '<': '[',
        '>': ']',
        '\*': '*',
        '/': '/',
        '!': '!'
    }
    for char in expression:
        if char in brackets:
            brackets[char] = False
        else:
            brackets[char] = True
    result = []
    while brackets:
        opening = brackets.pop(brackets.keys()[0])
        operand = []
        for char in expression:
            operand.append(char if brackets[opening] else char.upper())

        result.append(operand[0])

    return '\n'.join(result)
